import React from 'react'
import { View, Text } from 'react-native'
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs'
import { AppColor } from '../utils/StyleConstants';

import PendingScreen from '../models/pending-screen/PendingScreen';
import CompletedScreen from '../models/completed-screen/CompletedScreen';
import OverdueScreen from '../models/overdue-screen/OverdueScreen';

const MainTabNavigation = () => {
  const Tab = createBottomTabNavigator();
  return (
    <Tab.Navigator screenOptions={{ headerShadowVisible: false, tabBarActiveTintColor: AppColor.primary }}>
      <Tab.Screen name='PendingScreen' component={PendingScreen} options={{}}/>
      <Tab.Screen name='CompletedScreen' component={CompletedScreen} />
      <Tab.Screen name='OverdueScreen' component={OverdueScreen} />
    </Tab.Navigator>
  )
}

export default MainTabNavigation
